import React, { useState } from 'react';
import { Eye, EyeOff } from 'lucide-react';

const LoginForm = ({ onSubmit }) => {
  const [showPassword, setShowPassword] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({ email, password });
  };

  return (
    <form onSubmit={handleSubmit}>
      <button type="button" className="w-full bg-blue-600 text-white rounded-md py-2 mb-2 flex items-center justify-center">
        <span className="mr-2">f</span>
        Log in with Facebook
      </button>
      <button type="button" className="w-full border border-gray-300 rounded-md py-2 mb-2 flex items-center justify-center">
        <span className="mr-2">G</span>
        Log in with Google
      </button>
      <button type="button" className="w-full border border-gray-300 rounded-md py-2 mb-4 flex items-center justify-center">
        <span className="mr-2">üçé</span>
        Log in with Apple
      </button>

      <div className="text-center mb-4">or</div>

      <input
        type="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
        className="w-full border border-gray-300 rounded-md py-2 px-3 mb-2"
        required
      />
      <div className="relative">
        <input
          type={showPassword ? "text" : "password"}
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="w-full border border-gray-300 rounded-md py-2 px-3 mb-2"
          required
        />
        <button
          type="button"
          onClick={() => setShowPassword(!showPassword)}
          className="absolute right-3 top-2 text-gray-500"
        >
          {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
        </button>
      </div>

      <div className="text-right mb-4">
        <a href="#" className="text-blue-600 text-sm">Forgot password</a>
      </div>

      <button type="submit" className="w-full bg-blue-600 text-white rounded-md py-2 mb-4">
        Log in
      </button>

      <div className="text-center">
        Don't have an account yet? <a href="#" className="text-blue-600">Sign up</a>
      </div>
    </form>
  );
};

export default LoginForm;
